import React from "react";
import './Style.css'

const User = () => {
    return (
        <nav class="navbar">
        <ul>
            <li><a href="Index.html">Inicio</a></li>
            <li><a href="#">Quienes Somos</a></li>
            <li><a href="#">Productos</a></li>
            <li><a href="#">Contacto</a></li>
        </ul>
    </nav>
    )
}

export default User
